const app = getApp();

Page({
  data: {
    fileName: "选择文件",
    StatusBar: app.globalData.StatusBar,
    CustomBar: app.globalData.CustomBar,
    index: null,
    time: '12:00',
    date: '2020-4-15',
    textareaAInput(e) {
      this.setData({
        textareaAValue: e.detail.value
      })
    },
    title: "",
    content: "",
    groupID: "",
      newnotice_jpg:"data:image/jpg;base64,"
  },
  
  TimeChange: function(e) {
    var time = e.detail.value;
    //console.log("当前选择时间" + time);
    this.setData({
      time: time
    })
  },
  DateChange: function(e) {
    let date = e.detail.value
    //console.log(date)
    this.setData({
      date: date
    })
  },
  titleInput: function(e) {
    let title = e.detail.value
    this.setData({
      title: title
    })
  },
  contentInput: function(e) {
    let content = e.detail.value
    this.setData({
      content: content
    })
  },
  //将通知内容写入数据库
  addNoticeintoDB: function(title, content, time, date, groupID) {

  },

  submit: function() {
    console.log(this.data.title)
    console.log(this.data.groupID)
    console.log(this.data.time)
    console.log(this.data.date)
    console.log(this.data.content)
    let that = this
    wx.request({
      url: "https://www.ningziqian.work:8000/insert_notice/",
      method: "POST",
      data: {
        notice_title: this.data.title,
        notice_content: this.data.content,
        notice_date: this.data.date,
        notice_time: this.data.time,
        notice_groupID: this.data.groupID
      },
      // 服务器返回信息，将信息存储至本地缓存
      success: function (res) {
        wx.request({
          url: "https://www.ningziqian.work:8000/noticeinfo/",
          method: "POST",
          data: {
            groupID: that.data.groupID
          },
          // 服务器返回信息，将信息存储至本地缓存
          success: function (res) {
            app.globalData.notices = res['data']
            console.log(res)
            wx.navigateBack({
              complete: (res) => {},
            })
          },
          fail: function (res) {
            console.log('submit fail');
          },
        })
      },
      fail: function (res) {
        console.log('submit fail');
      },
    })
  },
  onLoad: function(options) {
    console.log(options)
    this.setData({
      groupID: JSON.parse(options.groupID),
      groupName: JSON.parse(options.groupName),
    })
  },
})